  \"animals-individual-counts-flight-direction-species-identification-animals-group-behavior-an\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113338 includes meteorological,
  visual observation and biological data collected aboard the NEW HORIZON during cruises
  NH0005 and NH0007 in the North Pacific Ocean from 2000-05-30 to 2000-08-12. These
  data include ANIMALS - INDIVIDUAL - COUNTS, Flight direction, SPECIES IDENTIFICATION,
  ANIMALS - GROUP - BEHAVIOR and WIND SPEED. The instruments used to collect these
  data include visual observation. These data were collected by Cynthia Tynan of Northwest
  Fisheries Science Center - Seattle and David G. Ainley of H.T. Harvey & Associates
  as part of NEP. The Biological and Chemical Oceanography Data Management Office
  (BCO-DMO) submitted these data to NODC on 2013-09-24.nnThe following is the text
  of the abstract provided by BCO-DMO:nnGLOBEC NEP Northern California Current Bird
  DatanR/V New Horizon cruises NH0005 and 0007nNOTES:n(1) Please see companion file
  named 'metabirds' (http://globec.whoi.edu/jg/serv/globec/nep/metabirds.html0%7Bdir=globec.whoi.edu/jg/dir/globec/nep/,info=globec.whoi.edu/jg/info/globec/nep/metabirds%7D),
  which is supporting data for Bird Observations.nn(2) The following documentation
  is extracted from:nDavid G. Ainley, Larry B. Spear, Cynthia T. Tynan, John A. Barth,
  Stephen D. Pierce, R. Glenn Ford and Timothy J. Cowles, 2005. Physical and biological
  variables affecting seabird distributions during the upwelling season of the northern
  California Current. Deep Sea Research Part II: Topical Studies in Oceanography,
  Volume 52, Issues 1-2, January 2005, Pages 123-143nnAs a part of the GLOBEC-Northeast
  Pacific project, we investigated variation in the abundance of marine birds in the
  context of biological and physical habitat conditions in the northern portion of
  the California Current System (CCS) during cruises during the upwelling season 2000.
  Continuous surveys of seabirds were conducted simultaneously in June (onset of upwelling)
  and August (mature phase of upwelling).nn(3) Caution. Wind speed and direction may
  not be corrected for ship motion.nn(4) Additional documentation, in the form of
  references, was provided by Dr. Ainley.nnL.B. Spear, N. Nur & D.G. Ainley. 1992.
  Estimating absolute densities of flying seabirds using analyses of relative movement.
  Auk 109:385-389.nL.B. Spear & D.G. Ainley. 1997. Flight behaviour of seabirds in
  relation to wind direction and wing morphology. Ibis 139: 221-233.nL.B. Spear &
  D.G. Ainley. 1997. Flight speed of seabirds in relation to wind speed and direction.
  Ibis 139: 234-251.nL.B. Spear, D.G. Ainley, B.D. Hardesty, S.N.G. Howell & S.G.
  Webb. 2004. Reducing biases affecting at-sea surveys of seabirds: use of multiple
  observer teams. Marine Ornithology 32: 147-157.nnSpecies CodesnnCodenDescriptionnnAKCAnCassin's
